import React, {Component} from 'react';

class MyComponent extends Component{

	render(){
		var receta = {
			nombre: 'Pizza',
			Ingredientes:[
				{
					nombre: 'tomate',
					cantidad: 5
				},
				{
					nombre: 'queso',
					cantidad: 8
				},
				{
					nombre: 'masa',
					cantidad: 2
				}
			],
			calorias: 300
		};

		return(
			<h1>Receta de : {receta.nombre}</h1>
		);
	}
}

export default MyComponent;
